import { Component } from "react";

class Button extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isShip: " ",
    };
  }

  getDeliveryStatus(shipmentOrder) {
    const result = 0;
    switch (shipmentOrder) {
      case 0:
        result += 1;
      case 1:
        result += 2;
      case 2:
        result += 3;
    }
  }

  getRandomDeliveryStatus() {
    if (this.getDeliveryStatus === 1) {
      this.setState({
        isShip: "Tao la so 1",
      });
    }
    if (this.getDeliveryStatus === 0) {
      this.setState({
        isShip: "Tao la so 2",
      });
    } else if (this.getDeliveryStatus === 2) {
      this.setState({
        isShip: "Tao la so 0",
      });
    }
  }

  randomDeliveryStatus() {
    setInterval(() => {
      this.getRandomDeliveryStatus();
    }, 1000);
  }

  render() {
    this.randomDeliveryStatus();
    const { currentDeliveryStatus } = this.state;
    return <div className="ranDomDeliveryStatus">{currentDeliveryStatus}</div>;
  }
}

export default Button;
